import { Button } from "@chakra-ui/react";
import React from "react";

function VerifyEmail(props) {
  console.log(props);
  return (
    <div>
      <h1>Email verification</h1>
      <h1>{props.match.params.token}</h1>
      <Button>Login</Button>
    </div>
  );
}

export default VerifyEmail;
